import React from 'react';
import {Link} from "react-router-dom";
import {connect} from "react-redux";
import {App, AppState, AppWithServerData, MainActions, MainState} from "../types/types";
import {
    addNewApp,
    editApp, exit,
    getMainData,
    removeApp,
    startOrStopApp
} from "../actions/actions";
import {AppList} from "../components/appsList";
import {AppControl} from "../components/appsControl";


const {useEffect} = React;

interface Props {
    getMainData: (email: string) => void;
    addNewApp: (app: AppWithServerData, email: string | null) => void;
    removeApp: (id: string) => void;
    editApp: (app: App) => void;
    startOrStopApp: (id: string) => void;
    exit: (props: any) => void;
    state: AppState;
}

const {useState} = React;

const MainPage: React.FC<Props> = props => {

    const [page, setPage] = useState('1');
    const [isLoading, setIsLoading] = useState(true);

    // useEffect(() => {
    //     const {currentUser} = props.state;
    //     if (currentUser) {
    //         getMainData(currentUser);
    //     }
    // }, [props.state]);

    const doEx = () => {
        exit(props);
    };
    const EMPTY: any = [];

    // const addApp = (e: React.SyntheticEvent<HTMLButtonElement>): void => {
    //     alert('    ,     ()');
    //
    //     let app: AppWithServerData = {
    //         appLang: state.appLang,
    //         id: "1",
    //         serverType: state.serverType,
    //         name: state.appName,
    //         ip: state.ip,
    //         link: state.rep,
    //         port: state.port,
    //         status: 'online',
    //         type: state.appType,
    //         login: state.loginForServer,
    //         password: state.passwordForServer
    //     };
    //     addNewApp(app, props.state.currentUser);
    // };

    const changePage = (e: React.SyntheticEvent, page: string) => {
        e.currentTarget.classList.add('header-link-selected');
        setPage(page);
    }

    return (
        <div>
            <div className={'header'} style={{background: 'white'}}>
                <Link to={'/help/'} className={'btn'}>Help</Link>
                <Link to={`/main/${props.state.currentUser}`} className={'btn btn-selected'}>Main page</Link>
                <Link to={'/login/'} onClick={() => doEx()} className={'btn'}>Exit</Link>
            </div>
            <div className={'main'}>
                <div className="header-main">
                    <a href="#" className="header-link header-link-selected" onClick={(e) => changePage(e, '1')}>App
                        control</a>
                    <a href="#" className="header-link" onClick={(e) => changePage(e, '2')}>DataBase control</a>
                </div>
                {page === '1' && isLoading !== true ?
                    <div>
                        <AppControl addNewApp={props.addNewApp} currentUser={props.state.currentUser}/>
                        <AppList apps={props.state.profile.appList || EMPTY} editApp={props.editApp}
                                 removeApp={props.removeApp}
                                 startOrStopApp={props.startOrStopApp}/>
                    </div> : null}
            </div>
        </div>
    );
};


const mapStateToProps = (state: any) => ({
    state: state.appReducer
});


const actions = {
    getMainData,
//     createNewConfig,
//     addNewServer,
    addNewApp,
//     removeServer,
    removeApp,
    editApp,
//     editServer,
    exit,
    startOrStopApp
};

export default connect(mapStateToProps, actions)(MainPage);
